import { TestCreateStudent } from './TestCreateStudent'
import { useEffect, useState } from "react"
import { fetchUserStudents } from "../services/studentServices"
import { Link } from "react-router-dom"

export const TestModule = ({ user }) => {

    const [students, setStudents] = useState([])
    const [toggle, setToggle] = useState(false)

    const handleToggle = () => {
      setToggle(!toggle)
    }

    const handleFetchCalls = () => {
      fetchUserStudents(user.id).then((data) => {
        setStudents(data)
      })
    }

    useEffect(() => {
      handleFetchCalls()
    }, [user])

    // teacher view should be able to view ALL students she creater
    // parent view should be able to view only the student she syncs with the student code

    return (
        <>
            <TestCreateStudent user={user} />
        </>
    )
}
